    @Test(timeOut = 2000)
    public void testWarmWeatherStrategy() throws IOException {
        OnlineDataController dataController = new OfflineDataController(TestType.HOTTEST_CITY);
        TravelAgency travelAgency = new TravelAgency(new ArrayList<>(List.of("Hot1", "Hot2", "Hot3", "Hot4", "Hot5")), dataController);

