        Optional<City> perfectCity = travelAgency.findSuitableCitiesForClient(client);
        assertTrue(perfectCity.isPresent(), "Strategy did not return a city.");

        assertEquals(perfectCity.get().getName(), "Hot5");
        assertEquals(perfectCity.get().getAverageTemperature(), 50.00);
        assertEquals(perfectCity.get().getAverageHumidity(), 0.00);

        travelAgency.addCity("Hot6");
        Optional<City> newPerfectCity = travelAgency.findSuitableCitiesForClient(client);
        assertTrue(newPerfectCity.isPresent());
        assertNotEquals(perfectCity, newPerfectCity);
        assertEquals(newPerfectCity.get().getName(), "Hot6");
        assertEquals(newPerfectCity.get().getAverageTemperature(), 60.00);
    }

    @Test(timeOut = 2000)
