        OnlineDataController dataController = new OfflineDataController(TestType.HATES_RAIN);
        TravelAgency travelAgency = new TravelAgency(new ArrayList<>(List.of("Rain1", "Rain2", "Rain3", "Rain4", "Rain5")), dataController);

        Client client = new Client("SugarCube", "CandyLand", hatesRainStrategy);

        Optional<City> perfectCity = travelAgency.findSuitableCitiesForClient(client);
        assertTrue(perfectCity.isPresent(), "Did not find a city!");
        assertEquals(perfectCity.get().getName(), "Rain2");
        assertEquals(perfectCity.get().getAverageHumidity(), 20.0, 0.01);

        travelAgency.addCity("Rain6");
        Optional<City> newPerfectCity = travelAgency.findSuitableCitiesForClient(client);
        assertTrue(newPerfectCity.isPresent());
        assertNotEquals(perfectCity, newPerfectCity);

        assertEquals(newPerfectCity.get().getName(), "Rain6");
        assertEquals(newPerfectCity.get().getAverageHumidity(), 0.0, 0.01);
        assertTrue(newPerfectCity.get().getWeatherCodes().stream().allMatch(Predicate.isEqual(800)));
    }

    @Test(timeOut = 2000)
    public void testLovesChangeStrategy() throws IOException {
        OnlineDataController dataController = new OfflineDataController(TestType.LOVES_CHANGE);
        TravelAgency travelAgency = new TravelAgency(new ArrayList<>(List.of("Change1", "Change2", "Change3")), dataController);

        Client client = new Client("Tharizdun", "Void", lovesChangeStrategy);

        Optional<City> perfectCity = travelAgency.findSuitableCitiesForClient(client);
        assertTrue(perfectCity.isPresent());

        assertEquals(perfectCity.get().getName(), "Change3");

        travelAgency.addCity("Change4");
        Optional<City> newMostPerfectCity = travelAgency.findSuitableCitiesForClient(client);
        assertTrue(newMostPerfectCity.isPresent());
